def isAnagram(s,t):
    anagram = False
    if len(s) == len(t):
        sMap = {}
        for c in s:
            if c in sMap:
                sMap[c] += 1
            else:
                sMap[c] = 1
        print('sMap = ', sMap)

        tMap = {}
        for c in t:
            if c in tMap:
                tMap[c] += 1
            else:
                tMap[c] = 1
        print('tMap = ', tMap)

        yes = 0
        no = 0
        for c in s:
            if c not in tMap:
                print('c not in tMap: ', c)
                anagram = False
                return anagram
            else:
                if sMap[c] == tMap[c]:
                    print('sMap[c] == tMap[c] > ', c)
                    yes += 1
                else: 
                    print('sMap[c] != tMap[c] > ', c)
                    no += 1
        if no > 0:
            anagram = False
        else:
            anagram = True
    return anagram

